import React from 'react';

import Post from './Post';


const ListPost = (props) => {

    return (
        <div className="col-6 sinPading espizq">
            const { posts, onDelete} = props;
            <div className="row">
                {posts.map((post) => {
                    return (
                        <Post
                            key={posts.id}
                            id={posts.id}
                            name={posts.name}
                            onDelete={onDelete} />
                    );
                })}
            </div>

        </div>
    );
};

export default ListPost;
